import { useContext, useState } from "react";
import SignedinLayout from "../../components/layout/SignedinLayout";
import { Context } from "../../App";
import "./ComplaintsAdmin.css";

export default function ComplaintsAdmin() {
  const { currentUser } = useContext(Context);
  let complaints = JSON.parse(localStorage.getItem("complaints"));
  const [clickedComplaint, setClickedComplaint] = useState(null);
  const [updatedStatus, setUpdatedStatus] = useState("");

  // Function to handle clicking on a complaint row
  const handleRowClick = (complaint) => {
    setClickedComplaint(complaint);
    setUpdatedStatus(complaint.status);
  };

  // Function to update the status of the complaint
  const handleStatusUpdate = () => {
    // Update the status in the complaints array or in the localStorage, depending on your implementation
    // For example, you can use setState to update the status in the complaints array
    // Or you can use localStorage.setItem to update the status in the stored complaints
    // For simplicity, I'll assume you are using setState to update the status in the complaints array
    const updatedComplaints = complaints.map((complaint) =>
      complaint.id === clickedComplaint.id
        ? { ...complaint, status: updatedStatus }
        : complaint
    );
    complaints = updatedComplaints;
    // Close the complaint details pop-up after updating the status
    setClickedComplaint(null);
  };

  return (
    <>
      <SignedinLayout />
      <div className="user">
        <div className="viewData">
          {clickedComplaint && (
            <div className="complaint-pop-up">
              <h4>{clickedComplaint.subject}</h4>
              <p>Complaint Type: {clickedComplaint.complaintType}</p>
              <p>Complaint ID: {clickedComplaint.id}</p>
              <p>Severity: {clickedComplaint.severity}</p>
              <p>Status:</p>
              <input
                type="text"
                value={updatedStatus}
                onChange={(e) => setUpdatedStatus(e.target.value)}
              />
              <button onClick={handleStatusUpdate}>Update Status</button>
              <button onClick={() => setClickedComplaint(null)}>Close</button>
            </div>
          )}
        </div>
        <div className="container">
          <h3>All Complaints</h3>
          <br />
          <table>
            <thead>
              <tr>
                <th>SUBJECT</th>
                <th>COMPLAINT TYPE</th>
                <th>COMPLAINT ID</th>
                <th>SEVERITY</th>
                <th>STATUS</th>
              </tr>
            </thead>
            <tbody>
              {complaints &&
                // eslint-disable-next-line array-callback-return
                complaints.map((complaint, index) => {
                  return (
                    <tr
                      className="trData"
                      key={complaint.id}
                      onClick={() => handleRowClick(complaint)}
                    >
                      <td className="blueC">{complaint.subject}</td>
                      <td>{complaint.complaintType}</td>
                      <td className="blueC">{complaint.id}</td>
                      <td>{complaint.severity}</td>
                      <td className="status">{complaint.status}</td>
                    </tr>
                  );
                })}
            </tbody>
          </table>
        </div>
      </div>
    </>
  );
}
